import React, { Component } from 'react';
import { MENU_LINKS } from './constants';
import './index.scss';
import Link from 'next/link';
export default class NavigationMenu extends Component {
  constructor(props) {
    super(props);
    this.state = {
      current: undefined
    };
  }
  render() {
    return (
      <div className="navigation-menu">
        {MENU_LINKS.map((link, index) => (
          <Link href={link.href}>
            <a>מי אנחנו?</a>
          </Link>
        ))}
      </div>
    );
  }
}
